import Platforms from './components/Platforms';
const Home = () => {
  const rowStyle = {
    borderBottom: "2px solid #eee",
    width: "50%",
  }

  return (
    <div className="container-fluid" style={{maxWidth: "1400px"}}>
      <HeaderSection />
  <div className="container">
  <div className="row m-auto p-4" style ={rowStyle}>
    <h1 className="m-auto">Listen To Us On ...</h1>
  </div>
      <Platforms />
      <Team />
    </div>
        </div>
  )
}

export default Home;
